import dateTimeFormat from "./funcDateTimeFormat"

function rangeHours() {
  const date = new Date()

  const arrHours = []

  for (let i = 1; i <= 84; i++) {
    if (i <= 12) {
      arrHours.push(
        <div
          id={Intl.DateTimeFormat("en-RU", {
            month: "numeric",
            day: "numeric",
            year: "numeric",
          }).format(new Date())}
          key={i}
        >
          {i + 9}
        </div>
      )
    }
    if (12 < i && i <= 24) {
      arrHours.push(
        <div
          id={Intl.DateTimeFormat("en-RU", {
            month: "numeric",
            day: "numeric",
            year: "numeric",
          }).format(date.setDate(date.getDate() + 1))}
          key={i}
        >
          {i - 3}
        </div>
      )
    }
